import Nav from 'react-bootstrap/Nav'
import Navbar from 'react-bootstrap/Navbar';
import NavLink from "react-bootstrap/NavLink"
import Container from 'react-bootstrap/Container';

function Header() {
    return(
        <Navbar collapseOnSelect expand="md" bg="light" variant="light" className='justify-content-between'>
            <Container id="header">
                <Navbar.Brand href="/" className='align-items-center mx-3'></Navbar.Brand>
                {/* This is the hamburger menu */}
                <Navbar.Toggle  className='mx-3' aria-controls="navbarScroll" data-bs-targets="#navbarScroll"></Navbar.Toggle>
                {/* pre collapsed navbar */}
                <Navbar.Collapse className="justify-content-end" id="navbarScroll">
                <Nav className='align-items-end px-4'>
                    <NavLink eventKey="1" href="/" >Home</NavLink>
                    <NavLink eventKey="2" href="/services" >Services</NavLink>
                    <NavLink eventKey="3" href="/about" >About</NavLink>
                    <NavLink eventKey="4" href="/contact" >Contact</NavLink>
                    <NavLink eventKey="5" href="/faq" >FAQ</NavLink>
                </Nav>
                </Navbar.Collapse>
            </Container>        
        </Navbar>
    )
}

export default Header;
